import React from 'react';
import {contactPage} from '../../../constants/constants';

function newCabin() {
    const options = {
      method: 'POST',
      headers : {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(contactPage)

    }
    fetch('/cabins', options)
      .then(response => response.json())
      .then(data => {
        console.log(data);
      })
  };

export default function PostCabin (props) {
    return(
        <div>
            <p>Hello from PostCabin</p>
            <button onClick={newCabin()}>Post a cabin</button>
        </div>
    )
}
